      "prompt": "Create an extremely detailed hyperrealistic portrait of a young woman. Focus on showing every pore of her skin, individual strands of hair, and subtle reflections in her eyes. The background should be a blurred cityscape, with soft, natural lighting enhancing the depth and realism of the image."
    },
