      "style": "Steampunk",
      "prompt": "Design a steampunk character, an inventor, wearing Victorian-era clothing with visible gears and steam-powered gadgets. The character should have goggles on their forehead and a mechanical arm. The setting is a workshop filled with intricate machines and steam engines, with a warm, sepia-toned color palette."
    },
    {
      "style": "Pop Art",
      "prompt": "Create a pop art image of a retro telephone with a bright red rotary dial. Use bold, saturated colors and thick black outlines to mimic a comic book style. Incorporate halftone dots and speech bubbles with playful, exaggerated text to add a dynamic, lively feel to the artwork."
    },
    {
      "style": "Medieval Fantasy",
      "prompt": "Illustrate a medieval fantasy character, a knight in shining armor, standing in an enchanted forest. The armor should be highly detailed, reflecting the dappled sunlight filtering through the trees. Add a mythical creature, like a small dragon perched on the knight's shoulder, to emphasize the magical theme."
    },
    {
      "style": "Cubism",
      "prompt": "Create a cubist representation of a violin. Deconstruct the violin into geometric shapes, showing multiple angles and perspectives simultaneously. Use a palette of muted earth tones with occasional bright accents to create a sense of movement and complexity in the composition."
    }
  ]
